Episode Title: &quot;Parole Model; Green Pool, Angry People!&quot;
Episode Order: Season 18, Episode 172
Original Air Date: March 13, 2014

&quot;Burglary, attempted sexual abuse and giving up a child for adoption come into play when unwed parents fight over property; a man accuses his former landlord of illegally forcing him to move out and denies causing extensive damage to the rental home.&quot;

Seed and enjoy!
